import React from 'react';

function Lineup({name, image}) {
  return (
    <div>
      <h1>Today's player is {name}</h1>;
      <img src = {image} />
    </div>
  )
}

const roaster = [
  {
    name: 'Messi',
    image: 'lineup1'
  },
  {
    name: 'Suarez',
    image: 'lineup2'
  }
];

function App() {
  return (
    <div>
      {roaster.map(player => (
        <Lineup name = {player.name} />
      ))}
    </div>
  );
}

export default App;
